import * as React from 'react';
import './Style.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import LoginReset from './components/LoginReset';
import LoginBlocked from './components/LoginBlocked';
import SettingsAssetsTowerCrane from './components/SettingsAssets_TowerCrane';
import SettingsSystem from './components/SettingsSystem';
import SettingsPeople from './components/SettingsPeople';

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route exact path='/' element={<Login/>}/>
          <Route exact path='/reset' element={<LoginReset/>}/>
          <Route exact path='/login_blocked' element={<LoginBlocked/>}/>
          <Route exact path='/settings-system' element={<SettingsSystem/>}/>  
          <Route exact path='/settings-people' element={<SettingsPeople/>}/>  
          <Route exact path='/settings-assets' element={<SettingsAssetsTowerCrane/>}/>  
        </Routes>
      </Router>
    </>
  );
}

export default App;
